import React from "react";
import Card from "./components/Card";
import jobBoards from "./jobBoards.json";

import "./App.css";

function App() {
  const jobData = jobBoards.job_boards.map((data) => {
    console.log(data.name);
  });

  return (
    <div className="App">
      <h1>Job Source Resolver</h1>
      {jobData.map((data) => {
        return <Card description={data.name} />;
      })}
    </div>
  );
}

export default App;
